/*
  Course: INT-499 Capstone in Information Technology
  Instructor: John Russel
  Group 1: Dominick Aduamankwah, Joshua Coman, Alberto Jiminez, Sarah Wilson
*/


import movieIcon from "../assets/icons/movie.svg";
import cartIcon from "../assets/icons/cart.svg";

export default function Navbar() {
  return (
    <nav className="navbar">
      <ul>
        <li>
          <img src={movieIcon} alt="Movies" style={{ width: "20px", marginRight: "5px" }}/>
          Movies
        </li>
        <li>
          <img src={cartIcon} alt="Cart" style={{ width: "20px", marginRight: "5px" }}/>
          Cart
        </li>
      </ul>
    </nav>
  );
}
